export const stationLoginOptions: string[] = Array.from(
  new Set([
    ...initialTrucks.map(t => t.station),
    ...Object.values(detachmentParentMap),
    'O.C.O.B.'
  ])
).sort((a, b) => {
    if (a === 'O.C.O.B.') return 1;
    if (b === 'O.C.O.B.') return -1;
    return a.localeCompare(b);
});

export const initialStationCodes: Record<string, string> = stationLoginOptions.reduce((acc, station) => {
  if (station === 'ESTACIÓN I PUERTO MADERO') {
    acc[station] = '101';
  } else if (station === 'ESTACIÓN II PATRICIOS') {
    acc[station] = '201';
  } else if (station === 'O.C.O.B.') {
    acc[station] = '71001';
  } else {
    acc[station] = '1234';
  }
  return acc;
}, {} as Record<string, string>);

